import React, { Component } from 'react'
class Error extends Component {
    state = {
        time: ""
    }
    times=()=>{
        fetch("https://www.teamoclock.com/api/v2/")
            .then(response => response.json())
            .then(data => this.setState({time: data}))
    }
    render() {

        return (
            <div>
                <h2>Ooops!</h2>
                <h4>Page not found.</h4>
                <b>{this.state.time}</b>
            </div>
        )
    }
}
